import allframeimage from './Frame467.png'
import groupoptions from './Group478.png'
import './index.css'

const AllFrameOptions = () => {
  return (
    <div className='framecontainer'>
        <div>
        <img className='frameoption' src={allframeimage} alt="AllFRAME" />
        <img className='frameoption' src={groupoptions} alt="AllFRAME" />
        </div>
        
    </div>
  );
}

export default AllFrameOptions;
